import { Button, Popconfirm } from "antd";
import React from "react";

const TaskList = ({ task }) => {
    return (
        <div style={{display:"flex"}}>
            <Button style={{color:"black",flex:1,marginRight: '10px' }} >{task}</Button>

            <Popconfirm
                            title="Bu görevi silmek istediğinizden emin misiniz?"

                            okText="Evet"
                            cancelText="Hayır"
                        >
                            <Button type="primary">Sil</Button>
                        </Popconfirm>

        </div>


    );
}
export default TaskList;
